const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "african-swine-fever-asf-unsupervised-machine-learning"
    }}>{`African Swine Fever (ASF) Unsupervised Machine Learning`}</h1>
    <p>{`The main purpose of this project is to detect suspicious shipments based on past import data. As such, this project aims at utlizing unsupervised machine learning techniques on the African Swine Fever (ASF) dataset for meaningful insight extraction and data analysis. `}</p>
    <h2 {...{
      "id": "data-description"
    }}>{`Data Description`}</h2>
    <p>{`The following includes the set of features utilized in our analysis: `}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Feature Number`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Feature Name`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Feature Type`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`1`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Country of Origin`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`2`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Hs-Code`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`3`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Port of Entry`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`4`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Broker ID`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`5`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Business Number`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`6`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Vendor`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`7`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`CFIA Decision Type`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`8`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`CBSA Decision Type`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Nominal`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`9`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Commodity Description`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Text`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`10`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Commodity Line Total Price`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Numerical`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`11`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Commodity Line Unit Price`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Numerical`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`As can be seen from the table above, the import dataset is, for the most part, composed of nominal data. Nominal categorical data are intrinsically unordered. Additionally, and contrary to continuous variables, nominal variables lack any meaningful sense of distance between the different nominal categories. As such, the nature of the prevailing nominal variables in our dataset, in addition to the lack of continuous variables dictate a rather intensive process of feature preprocessing.  `}</p>
    <h2 {...{
      "id": "feature-selection-and-preprocessing"
    }}>{`Feature Selection and Preprocessing`}</h2>
    <h3 {...{
      "id": "nominal-variables"
    }}>{`Nominal Variables`}</h3>
    <p>{`The approach in `}<a parentName="p" {...{
        "href": "https://www.researchgate.net/publication/278403191_Numerical_Coding_of_Nominal_Data"
      }}>{`Numerical Coding of Nominal Data`}</a>{` was utilized to extract a meaningful representation of the categorical features in the import dataset. The authors propose a mapping of the nominal data into the complex plane. The mapping takes into account the frequency of categories both by their own merit and relative to that of other categories. Accordingly, and due to the partial ordering inherent to the complex plane, this presentation serves to preserve the lack of order characteristic of nominal data. As such, this approach was used in numerically encoding features 1 through 8 which are of a nominal nature. `}</p>
    <p>{`To further enrich the earlier representation, we proposed the introduction of a conditional mapping. This mapping is used to extract information from the dataset conditioning the data based on two factors. `}</p>
    <ul>
      <li parentName="ul">{`Time Period (Monthly, Quarterly, Semi-Annually and Annually). `}</li>
      <li parentName="ul">{`Groups in other categorical features.
First, the mapping into the complex plane is conditioned over time to extract the changes in a monthly, quarterly, semi-annually and annually manner therefore extracting the representation of each group relative to the different time periods in the data. Second, in order to extract category specific differences (e.g., how the country of origin or a given HS code is distributed with respect to individual brokers), we condition over categories in the features of the dataset itself.
The main rational of the earlier approach is that the distribution of categroies should be inherently different when conditioned on a specific group or time period which would thus enable us to extract more information from our data. Having applied this conditional mapping the seperation in the data is significantly improved. `}</li>
    </ul>
    <h3 {...{
      "id": "volume"
    }}>{`Volume`}</h3>
    <p>{`The volume of the different shipments is reported in different units. As such, we have only isolated the most two frequent units of volume (The number of pieces and weight in KGM). The missing number of pieces for shipments reporting any other units was calculated by dividing the total price by the price per unit. Then an iterative imputer was utilize to find the missing entries for the volume in KGM. The iterative imputer was trained using features () and the numerical encoding of nominal features without the conditional mapping. `}</p>
    <h3 {...{
      "id": "commodity-description"
    }}>{`Commodity Description`}</h3>
    <p>{`Word embeddings are utilized in preprocessing the commodity description. For reprodusability randomized hashing should be disabled using the following command `}</p>
    <pre><code parentName="pre" {...{}}>{`PYTHONHASHSEED=random
`}</code></pre>
    <h2 {...{
      "id": "pipeline"
    }}>{`Pipeline`}</h2>
    <p>{`Principal Component Analysis (PCA) was used for dimensionality reduction. With the goal of flagging suspicious shiptments, that was followed by the application of two seperate approaches `}</p>
    <ul>
      <li parentName="ul">{`Approach 1: Unsupervised Machine Learning (K-Means)
Several runs K-Means were applied at a different number of clusters. This was done with the goal of capturing data falling under two categories: `}<pre parentName="li"><code parentName="pre" {...{}}>{` * An (approved) decision type which is grouped together with the (non-approved) instances in the same cluster. 
 * Small size clusters of (approved) decision type instances. 
`}</code></pre></li>
    </ul>
    <p>{`The results over a sample dataset are demonstrated in the following figure of the most signicant 3 principal components `}</p>
    <p>{` `}<img parentName="p" {...{
        "src": "/img/clustering.png",
        "alt": "Test Image 1"
      }}></img></p>
    <ul>
      <li parentName="ul">{`Approach 2: Noisy Labels
The nominal encoding of features relating to the CFIA and CBSA decision as well as anything conditioned on them is removed. CFIA Decision is treated as a noisy label and a classifier is trained to detect noise in this label (based on the work in `}<a parentName="li" {...{
          "href": "https://github.com/cgnorthcutt/cleanlab"
        }}>{`CleanLab`}</a>{`).
These two approaches were found to intersect for instances having the same broker in their majority.`}</li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
